import React, { Component } from 'react';
import { Table } from "reactstrap";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

class TransferList extends Component{
    constructor(props){
        super(props)
        this.state={
            Transfers:[],
            isLoaded:false
        }
    }
    async componentDidMount(){
        const url="http://localhost:3001/transfer"
        const response = await fetch(url)
        const data = await response.json()
        if(data.length>0){
            this.setState({Transfers:data})
            this.setState({isLoaded:true})
            toast.success('Data is Fetched SuccessFully.')
        }
        else
            toast.error('No Data to Display')
    }
    render(){

        return(
            <div>
                <ToastContainer position="top-right"
                    autoClose={5000}
                    hideProgressBar={false}
                    newestOnTop={false}
                    closeOnClick
                    rtl={false}
                    pauseOnFocusLoss
                    draggable
                    pauseOnHover/>
                <Table className="highlight">

                    <thead>
                        <tr>
                            <th data-field="NID">NurseID</th>
                            <th data-field="name">Name</th>
                            <th data-field="gender">Gender</th>
                            <th data-field="location">Location</th>
                            <th data-field="phone">Phone</th>
                            <th data-field="Email">Email</th>
                            <th data-field="date">Join Date</th>
                        </tr>
                    </thead>
                    <tbody>{this.showList()}</tbody>
                </Table>
            </div>
        )
    }
}
export default TransferList;
